      typeSpeed: 50,
      backSpeed: 25,
      backDelay: 1000,
      loop: true,
      showCursor: false
    }

    this.typed = new Typed(this.el, options);
  }

  componentWillUnmount() {
    this.typed.destroy();
  }

  render() {
    return (
      <div className="SkillPage">
        <section className="Skill-sect">
	  <div className="Skill-head">
            <div className="Skill-coll" id="SkiCollection">
